import React from 'react';
import './BankLogos.css';

const BankLogos = () => {
  const logos = [
    '/assets/images/BOB.png',
    '/assets/images/boi.png',
    '/assets/images/bom.jpeg',
    '/assets/images/canfin.png',
    '/assets/images/cb.png',
    '/assets/images/db.png',
    '/assets/images/KB.jpeg',
    '/assets/images/lic.jpeg',
    '/assets/images/PNB.jpeg',
    '/assets/images/psb.png',
    '/assets/images/sbi.jpeg',
    '/assets/images/tgb.png',
    '/assets/images/tmb.png',
    '/assets/images/ub.png',
    '/assets/images/uco.png',
  ];

  return (
    <div className="bank-logos">
      <h2 className="section-title">Empanelment - Our Partner Banks</h2>
      <div className="logos-container">
        {logos.map((logo, index) => (
          <img
            key={index}
            src={logo}
            alt={`Bank ${index + 1}`}
            className="bank-logo"
          />
        ))}
      </div>
    </div>
  );
};

export default BankLogos;
